  \"2015-10-15T06:42:07.978636\",\n\t\"name\": \"rsbs-mom-part-1-of-2-new-york-state-residential-statewide-baseline-study-survey-of-multifa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is part 1 (containing: Property Characteristics;
  Heating and Cooling; Water Heating; Tenant Appliances; Lighting; and Common Area)
  of 2; part 2 (https://data.ny.gov/d/hc4z-b2p5) contains: Purchasing Decisions; Washer
  and Dryer; and Miscellaneous.  The New York State Energy Research and Development
  Authority (NYSERDA), in collaboration with the New York State Department of Public
  Service (DPS), conducted a statewide residential baseline study (study) from 2011
  to 2014 of the single-family and multifamily residential housing segments, including
  new construction, and a broad range of energy uses and efficiency measures. This
  dataset includes data from 219 completed Multifamily owner and manager surveys.
  The types of data collected during the survey cover property characteristics, heating
  and cooling equipment, water heating equipment, tenant appliances, lighting, purchasing
  decision, common areas, clothes washing and drying, and miscellaneous equipment.
  The data is segmented to cover both common space equipment and, to the degree possible,
  tenant-unit equipment, such as refrigerators or clothes washers that are included
  in the rental by the building ownership.\",\n\t\"license_title\": \"License Not
